import React from 'react';
import './home.css';
import * as firebase from 'firebase';


import LoginDone from './logindone';
import Login from './login';


async function Logincheck()
{
  var finallog = "aaa";


  return await firebase.auth().onAuthStateChanged(function(user) {
    if (user) {
      finallog = <LoginDone />;
      alert(finallog);

    } else {
      finallog = <Login />;
    }
  }) .then(
    <div>
    dddddddddddddd
      {finallog}
    </div>
  );


}

export default Logincheck;
